import React from "react";
import './popup.css'


const Popup = (props) => {
const {ID, NAME, IMG} = props

    return(
            <li className="popup-li collection-item avatar">
                {console.log(ID)}
                <img src={''} alt="" className="circle"></img>
                <p className="black-text"><strong className="label">Title: </strong>{}</p>
                <p className="black-text"><strong className="label">count: </strong>{}</p>
            </li>
    )
}

export default Popup;
